import networkx as nx
from collections import defaultdict
import community as community_louvain
from cdlib import algorithms

def _build_graph(edges, weights):
    if len(weights) != len(edges): raise RuntimeError("weights must match edges length")
    G = nx.Graph()
    for (u, v), w in zip(edges, weights):
        G.add_edge(u, v, weight=float(w))
    return G

def louvain_clustering(edges, weights, resolution=1.0):
    G = _build_graph(edges, weights)
    part = community_louvain.best_partition(G, resolution=resolution, weight="weight")
    clusters = defaultdict(list)
    for node, cid in part.items():
        clusters[cid].append(node)
    return list(clusters.values())

def leiden_clustering(edges, weights, return_fitness=False):
    G = _build_graph(edges, weights)
    coms = algorithms.leiden(G, weights="weight")
    clusters = [list(c) for c in coms.communities]
    return (clusters, coms.newman_girvan_modularity()) if return_fitness else clusters

def _count_cluster_words(cluster, node_meta):
    count = 0
    for n in cluster:
        t = ", ".join(node_meta[n]["texts"])
        count += len(t.split())
    return count

def iterative_leiden(edges, weights, node_meta, max_words=30, max_iters=20):
    """
    Iteratively run Leiden until all clusters are smaller
    than `max_words` or until no further splitting is possible.
    """
    clusters = leiden_clustering(edges, weights)
    all_clusters = clusters[:]

    for _ in range(max_iters):
        new_clusters = []
        changed = False

        for cluster in all_clusters:
            word_count = _count_cluster_words(cluster, node_meta)

            if word_count > max_words and len(cluster) > 1:
                sub_edges, sub_weights = _subset_graph(cluster, edges, weights)
                subclusters = leiden_clustering(sub_edges, sub_weights)

                # --- SAFEGUARD: if Leiden can't split, keep as-is ---
                if len(subclusters) == 1 or subclusters == [cluster]:
                    new_clusters.append(cluster)
                else:
                    new_clusters.extend(subclusters)
                    changed = True
            else:
                new_clusters.append(cluster)

        all_clusters = new_clusters

        # stop early if nothing changed
        if not changed:
            break

    return all_clusters

def complete_iterative_leiden(edges, weights, max_iters=20):
    """
    Iteratively run Leiden until all clusters are smaller
    than `max_words` or until no further splitting is possible.
    """
    clusters = leiden_clustering(edges, weights)
    all_clusters = clusters[:]

    for _ in range(max_iters):
        new_clusters = []
        changed = False

        for cluster in all_clusters:

            if len(cluster) > 1:
                sub_edges, sub_weights = _subset_graph(cluster, edges, weights)
                subclusters = leiden_clustering(sub_edges, sub_weights)

                # --- SAFEGUARD: if Leiden can't split, keep as-is ---
                if len(subclusters) == 1 or subclusters == [cluster]:
                    new_clusters.append(cluster)
                else:
                    new_clusters.extend(subclusters)
                    changed = True
            else:
                new_clusters.append(cluster)

        all_clusters = new_clusters

        # stop early if nothing changed
        if not changed:
            break

    return all_clusters

def _subset_graph(cluster, edges, weights):
    """
    Restrict edges/weights to only nodes in the given cluster.
    """
    cluster_set = set(cluster)
    sub_edges, sub_weights = [], []
    for e, w in zip(edges, weights):
        if e[0] in cluster_set and e[1] in cluster_set:
            sub_edges.append(e)
            sub_weights.append(w)
    return sub_edges, sub_weights


def mini_graphs_from_clusters(edges, weights, clusters):
    """
    edges:    list[[u,v], ...]
    clusters: list of lists of node IDs, e.g. [[583,431], [14,18,16,15]]
    weights:  list[float] same length as edges (optional)
    relabel:  if True, relabel nodes inside each mini-graph to 0..k-1
    returns:  list of nx.Graph, one per cluster
    """
    G = _build_graph(edges, weights)
    mini_edges = []
    probs = []
    for cluster in clusters:
        H = G.subgraph(cluster).copy()  # induced subgraph (includes isolated nodes)
        mini_edges.append([[u, v] for u, v, _ in H.edges(data=True)])
        probs.append([d["weight"] for _, _, d in H.edges(data=True)])
    return mini_edges, probs

def build_meta_digraph(edges, probs, clusters):
    """Builds a meta graph from clusters. Turns cluster into one node (for a heirarchy).
    Normalises by number of nodes in a cluster. Therefore larger clusters don't have massive outgoing edge weights"""
    # Step 1: map node -> cluster_id
    node_to_cluster = {}
    cluster_sizes = {}
    for cid, cluster in enumerate(clusters):
        cluster_sizes[cid] = len(cluster)
        for node in cluster:
            node_to_cluster[node] = cid

    # Step 2: accumulate directed edge weights between clusters
    cluster_edge_weights = defaultdict(float)
    for (u, v), p in zip(edges, probs):
        cu, cv = node_to_cluster.get(u), node_to_cluster.get(v)
        if cu is None or cv is None:
            continue  # skip nodes not in any cluster
        if cu == cv:
            continue  # ignore intra-cluster edges
        cluster_edge_weights[(cu, cv)] += p

    # Step 3: normalize by source cluster size
    meta_edges, meta_probs = [], []
    for (cu, cv), total in cluster_edge_weights.items():
        w = total / cluster_sizes[cu]
        meta_edges.append([cu, cv])
        meta_probs.append(w)

    return meta_edges, meta_probs



